import React, { useState } from 'react';
import Navbar from './components/Navbar/navbar'; // Navbar ajustada com Tailwind
import Footer from './components/Footer/footer'; // Footer ajustado com Tailwind
import FileUploader from './components/FileUploader';
import ConverterForm from './components/ConverterForm';
import ProgressBar from './components/ProgressBar';
import { ThemeProvider, useTheme } from './context/ThemeContext'; // Contexto de Tema
import './index.css'; // Tailwind base

const App = () => {
  const [file, setFile] = useState(null);
  const [fileType, setFileType] = useState('');
  const [convertedFile, setConvertedFile] = useState(null);
  const [progress, setProgress] = useState(0);
  const [error, setError] = useState('');
  const [isProcessing, setIsProcessing] = useState(false);  // Para desabilitar o botão durante o processamento
  const { isDarkMode } = useTheme(); // Usando o tema global
  const apiURL = process.env.REACT_APP_API_URL;

  // Função para lidar com o upload do arquivo
  const handleFileUpload = (uploadedFile) => {
    const type = uploadedFile.type.split('/')[0]; // Ex.: "image/png" -> "image"

    // Verificação de tipo de arquivo
    if (!['image', 'audio', 'application'].includes(type)) {
      setError('Tipo de arquivo não suportado. Por favor, envie uma imagem, áudio ou documento.');
      setFile(null);
      return;
    }

    setFileType(type);
    setFile(uploadedFile);
    setConvertedFile(null);
    setError('');
  };

  // Função para lidar com a conversão de arquivos
  const handleConversion = (format) => {
    if (!file) {
      setError('Por favor, envie um arquivo primeiro.');
      return;
    }

    setIsProcessing(true); // Inicia o processo
    setProgress(20);
    const formData = new FormData();
    formData.append('file', file);
    formData.append('format', format);

    let apiEndpoint = `${apiURL}/convert/image`;
    if (fileType === 'audio') apiEndpoint = `${apiURL}/convert/audio`;
    else if (fileType === 'application' && file.name.endsWith('.pdf')) apiEndpoint = `${apiURL}/convert/pdf_to_images`;
    else if (fileType === 'application' && file.name.endsWith('.docx')) apiEndpoint = `${apiURL}/convert/docx_to_pdf`;

    fetch(apiEndpoint, {
      method: 'POST',
      body: formData,
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error('Erro ao processar o arquivo');
        }
        setProgress(70);
        return response.blob();
      })
      .then((blob) => {
        const downloadUrl = window.URL.createObjectURL(blob);
        setConvertedFile(downloadUrl);
        setProgress(100);
        setIsProcessing(false); // Finaliza o processo
      })
      .catch((err) => {
        setError(err.message || 'Erro inesperado ao converter o arquivo');
        setProgress(0);
        setIsProcessing(false); // Finaliza o processo
      });
  };

  // Função para resetar o estado do upload/conversão
  const reset = () => {
    setFile(null);
    setFileType('');
    setConvertedFile(null);
    setProgress(0);
    setError('');
    setIsProcessing(false);
  };

  return (
    <ThemeProvider>
      <div className={`app-container ${isDarkMode ? 'bg-gray-800 text-white' : 'bg-gray-50 text-gray-800'} min-h-screen flex flex-col items-center justify-center`}>
        <Navbar /> 

        <h1 className="text-4xl font-bold mb-6">Conversor de Arquivos</h1>

        {/* Mensagem de erro, caso exista */}
        {error && (
          <p className="text-red-500 text-lg">
            <strong>Erro:</strong> {error}
          </p>
        )}

        {/* Componente de upload de arquivos */}
        <FileUploader onFileUpload={handleFileUpload} reset={reset} />

        {/* Pré-visualização de imagem */}
        {file && fileType === 'image' && (
          <div className="mt-4">
            <img 
              src={URL.createObjectURL(file)} 
              alt="Pré-visualização" 
              className="max-w-lg rounded-lg shadow-md"
            />
          </div>
        )}

        {/* Exibição do formulário de conversão */}
        {file && (
          <ConverterForm
            onSubmit={handleConversion}
            formats={
              fileType === 'image'
                ? ['jpeg', 'png', 'gif', 'svg']
                : fileType === 'audio'
                ? ['mp3', 'wav', 'ogg', 'flac', 'aac']
                : file.name.endsWith('.pdf')
                ? ['png', 'jpeg', 'tiff', 'bmp']
                : ['pdf']
            }
            isProcessing={isProcessing} 
          />
        )}

        {/* Barra de progresso com animação */}
        {progress > 0 && <ProgressBar progress={progress} />}

        {/* Link para baixar o arquivo convertido */}
        {convertedFile && (
          <div className="mt-6">
            <a href={convertedFile} download="arquivo_convertido" className="bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600">
              Baixar Arquivo Convertido
            </a>
          </div>
        )}

        <Footer /> 
      </div>
    </ThemeProvider>
  );
};

export default App;
